import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './borrowerdash.css'; 

const OfficerProf = () => {
    const [searchQuery, setSearchQuery] = useState('');

    const handleSearchChange = (e) => {
        setSearchQuery(e.target.value);
        console.log("Search query: ", searchQuery);
        // Add any other logic to handle search filtering or API call
    };

    return (
        <header className="headdash">
            <img src="logo.png" alt="MSU-IIT NMPC Logo" className="logo" />
            <h2 className="dashh2">MSU-IIT National Multi-Purpose Cooperative</h2>
            
            <nav className="iconn">
                {/* Search bar */}
                <input
                    type="text"
                    placeholder="Search..."
                    value={searchQuery}
                    onChange={handleSearchChange}
                    className="searchbar"
                />
            </nav>
        </header>
    );
}

export default OfficerProf;
